import React from 'react';

function Footer() {
    return (
        <footer>
            <div className="container">
                <div className="box">
                    <h3>About us</h3>
                    <p>It was popularised in the 1960 with the release of Latest sheets containing Lorem Ipsum
                    passage.</p>
                    <button class="btn-secondary">Read More</button>
                </div>
            </div>
        </footer>
    );
}

export default Footer;
